// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract FLRegistry {
    event ClientCommit(
        uint256 indexed roundId,
        uint256 indexed clientId,
        bytes32 updateHash,
        uint32 numSamples,
        int96 epsilonTimes1e6,
        uint64 timestamp
    );

    event RoundFinalized(
        uint256 indexed roundId,
        bytes32 globalModelHash,
        string modelUri,
        uint32 numClients,
        uint64 timestamp
    );

    function recordClientCommit(
        uint256 roundId,
        uint256 clientId,
        bytes32 updateHash,
        uint32 numSamples,
        int96 epsilonTimes1e6
    ) external {
        emit ClientCommit(
            roundId,
            clientId,
            updateHash,
            numSamples,
            epsilonTimes1e6,
            uint64(block.timestamp)
        );
    }

    function recordRoundFinal(
        uint256 roundId,
        bytes32 globalModelHash,
        string calldata modelUri,
        uint32 numClients
    ) external {
        emit RoundFinalized(
            roundId,
            globalModelHash,
            modelUri,
            numClients,
            uint64(block.timestamp)
        );
    }
}

